import React, {Component} from 'react';
import 'materialize-css/dist/css/materialize.min.css';

import Drawer from '../Components/Drawer'

class Home extends Component {

    render() {
        return(
        <div>

            <nav>
            <a href="google.com" className="brand-logo"><Drawer/></a>
                <div className="nav-wrapper container">
                    <ul className="left">
                    <li><a href="sass.html">All Categories</a></li>
                    <li><a href="badges.html">All Times</a></li>

                    <div className="input-field col s6">
              <input id="input_text" type="text" data-length={10} />
              <label htmlFor="input_text">Input text</label>
            </div>
                    </ul>


                <ul id="nav-mobile" className="right hide-on-med-and-down">
                    <li><a href="google.com" className="brand-logo">Library </a></li>

                </ul>
                </div>

            </nav>
        </div>
        )
    }
}

export default Home;
